import  './Card.css';
import  img_mario from '../../img/videogame.png'




const Card = ({key, data})=>{
const name ="super mario";
const genres = "Ficcion"
    return (
        <div className='principal' name={key.id}>
            <div className="containerCard">
            <img src={data.background_image} alt={data.name} className='imagengame'/>
            <div className='submenuCard'>
                <div>{data.name}</div>
                <div>{data.genres}</div>
            </div>
        </div>
        </div>
        
    )
}

export default Card;
